import React,{useState} from "react";
function TODO(){
    const [todo , setTodo]=useState("");

    const onButtonClick=(e)=>{
      setTodo(e.target.value) 
    };

    return( <div>
       <form>
        <input
        type="text"
        value={todo}
        placeholder="todo"
        // onChange={(e)=>setTodo(e.target.value)}
        />
        <button
        onClick={onButtonClick}
        >Submit</button>
       </form>
        </div>
        )
}
export default TODO;
